 test user\n        Then Edit a random field and save\n        Then I should see the notification that \"User updated successfully!\"\n        When I select the Delete action for the test user\n        Then I confirm to delete the user\n        Then I should see the notification that \"User deleted successfully!\"\n\n    Scenario: Create user with invalid credentials\n        When I create a user with invalid credentials\n        And I should see the notification that \"Failed to create user!\"\n\n    Scenario: Delete user in the edit user window\n        Given I create a test user\n        And I select the Edit action for the test user\n        When I select Delete User from the edit user window\n        Then I confirm to delete the user\n        Then I should see the notification that \"User deleted successfully!\"\n\n    Scenario: Bulk user creation via CSV upload\n        When I start the bulk user creation process\n        And I upload the bulk user CSV file\n        When I save the bulk user creation\n        Then I should see the notification that \"Bulk Users Created Successfully!\"\n        And I send emails for bulk users\n        Then I should see the notification that \"Emails Triggered to Pending Users successfully !\"\n    \n","uri":"features\\User.feature","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"User create, edit, delete functionality","description":"","children":[{"background":{"id":"9fe4bf90-33a8-4981-a994-9c664d7e483a","location":{"line":3,"column":5},"keyword":"Background","name":"","description":"","steps":[{"id":"936a27ad-ba31-4735-ba14-0f220b78dc35","location":{"line":4,"column":9},"keyword":"Given ","keywordType":"Context","text":"I navigate to the login page"},{"id":"d0c023e4-fde2-4182-b50c-d37e0d8c4caa","location":{"line":5,"column":9},"keyword":"And ","keywordType":"Conjunction","text":"I login with valid credentials" 609-bccbb3fb75f6"]}]}},{"source":{"data":"# Feature: Workspace management\n\n#   Background:\n#     Given I navigate to the login page\n#     And I login as \"Global Admin\"\n#     Then I should see the home page\n\n#   Scenario: Create a new workspace\n#     When I click on the create button\n#     And I select workspace from the create options\n#     And I type the workspace name \"Cultfit\"\n#     And I click ok to create the workspace\n#     Then I should see \"New workspace successfully created!\"\n\n#   Scenario: Search and navigate to a workspace using the global search bar\n#     When I click on the global search bar\n#     And I type \"For\" in the search bar\n#     And I select \"Forma Gym\" from the search results\n#     Then I should be navigated to the \"Forma Gym\" workspace\n\n#   Scenario: Change plan and billing date in workspace\n#     Given I search and select \"Forma Gym\" workspace\n#     And I move to \"Billing\" tab\n#     When I change the workspace plan to \"Premium\"\n#     Then I should see the updated plan as \"Premium\"\n#     When I disable the workspace\n#     And I change the billing date to \"2024-12-01\"\n#     Then I should see the notification that \"Billing Date updated Successfully\"\n","uri":"features\\Workspace.feature","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"comments":[{"location":{"line":1,"column":1},"text":"# Feature: Workspace management"},{"location":{"line":3,"column":1},"text":"#   Background:"},{"location":{"line":4,"column":1},"text":"#     Given I navigate to the login page"},{"location":{"line":5,"column":1},"text":"#     And I login as \"Global Admin\""},{"location":{"line":6,"column":1},"text":"#     Then I should see the home page"},{"location":{"line":8,"column":1},"text":"#   Scenario: Create a new workspace"},{"location":{"line":9,"column":1},"text":"#     When I click on the create button"},{"location":{"line":10,"column":1},"text":"#     And I select workspace from the create options"},{"location":{"line":11,"column":1},"text":"#     And I type the workspace name \"Cultfit\""},{"location":{"line":12,"column":1},"text":"#     And I click ok to create the workspace"},{"location":{"line":13,"column":1},"text":"#     Then I should see \"New workspace successfully created!\""},{"location":{"line":15,"column":1},"text":"#   Scenario: Search and navigate to a workspace using the global search bar"},{"location":{"line":16,"column":1},"text":"#     When I click on the global search bar"},{"location":{"line":17,"column":1},"text":"#     And I type \"For\" in the search bar"},{"location":{"line":18,"column":1},"text":"#     And I select \"Forma Gym\" from the search results"},{"location":{"line":19,"column":1},"text":"#     Then I should be navigated to the \"Forma Gym\" workspace"},{"location":{"line":21,"column":1},"text":"#   Scenario: Change plan and billing date in workspace"},{"location":{"line":22,"column":1},"text":"#     Given I search and select \"Forma Gym\" workspace"},{"location":{"line":23,"column":1},"text":"#     And I move to \"Billing\" tab"},{"location":{"line":24,"column":1},"text":"#     When I change the workspace plan to \"Premium\""},{"location":{"line":25,"column":1},"text":"#     Then I should see the updated plan as \"Premium\""},{"location":{"line":26,"column":1},"text":"#     When I disable the workspace"},{"location":{"line":27,"column":1},"text":"#     And I change the billing date to \"2024-12-01\""},{"location":{"line":28,"column":1},"text":"#     Then I should see the notification that \"Billing Date updated Successfully\""}],"uri":"features\\Workspace.feature"}},{"stepDefinition":{"id":"ab9a24d9-c7ea-484a-95db-5a79166885d1","pattern":{"source":"I create a test admin","type":"CUCUMBER_EXPRESSION"},"sourceReference":{"uri":"steps\\AdminPanel.steps.ts","location":{"line":5}}}},{"stepDefinition":{"id":"742ee0ad-0d5e-4da1-9929-094a977165e6","pattern":{"source":"I navigate to {string}","type":"CUCUMBER_EXPRESSION"},"source
